import React from 'react';
import ReactDOM from 'react-dom'
import Home from './Home';
import NavBar from './NavBar';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <NavBar />
      </header>
      <main>
        <body>
        <div id="intro" class="view">
          <div class="full-bg-img">
            </div>
            </div>
        </body>
      </main>
    </div>
  );
}

export default App;
